import React, { Component } from 'react'
import axios from 'axios'

import OcrResultSkeleton from '../../components/OcrResultSkeleton/OcrResultSkeleton'

export default class ScanResultPage extends Component {

    constructor(props) {
        super(props)
        console.log(props)

        this.state = {
            result: ""
        }
    }

    componentDidMount() {
        const config = { headers: { 'Content-Type': 'multipart/form-data' } };
        let fd = new FormData();

        fd.append('file', this.props.location.state.file)

        axios.post('http://127.0.0.1:8000/ocr/', fd, config)
          .then((response) => {
            console.log(response);
          })
          .catch(error => {
              console.log(error);
          })
    }



    render() {
        return (
            <div>
                burası result ağla
                <div>
                    {this.props.location.state.file.preview}
                </div>
                <img
                    src={this.props.location.state.file.preview}
                    />


            </div>
        )
    }
}
